) –°–≤—ñ–¥–æ–º–µ ‚Äî $consciousCard (45-55 —Å–ª—ñ–≤): —Ü—ñ–ª—ñ, –æ—á—ñ–∫—É–≤–∞–Ω–Ω—è –∞–±–æ —Ç–µ, —â–æ $userName —É—Å–≤—ñ–¥–æ–º–ª—é—î.\n8) –ù–∞–π–±–ª–∏–∂—á–µ –º–∞–π–±—É—Ç–Ω—î ‚Äî $hiddenCard (45-55 —Å–ª—ñ–≤): –π–º–æ–≤—ñ—Ä–Ω–∏–π —Ä–æ–∑–≤–∏—Ç–æ–∫ —É –Ω–∞–π–±–ª–∏–∂—á—ñ —Ç–∏–∂–Ω—ñ.\n9) –í–Ω—É—Ç—Ä—ñ—à–Ω—î –Ø ‚Äî $selfCard (45-55 —Å–ª—ñ–≤): —Å—Ç–∞–Ω, —Ä–µ—Å—É—Ä—Å–∏ $userName.\n10) –û—Ç–æ—á–µ–Ω–Ω—è ‚Äî $environmentCard (45-55 —Å–ª—ñ–≤): –≤–ø–ª–∏–≤ –ª—é–¥–µ–π —ñ –æ–±—Å—Ç–∞–≤–∏–Ω.\n11) –ù–∞–¥—ñ—ó / —Å—Ç—Ä–∞—Ö–∏ ‚Äî $hopesCard (45-55 —Å–ª—ñ–≤): –æ—á—ñ–∫—É–≤–∞–Ω–Ω—è –∞–±–æ –ø–æ–±–æ—é–≤–∞–Ω–Ω—è $userName.\n12) –ü—ñ–¥—Å—É–º–æ–∫ ‚Äî $outcomeCard (45-55 —Å–ª—ñ–≤): –π–º–æ–≤—ñ—Ä–Ω–∏–π —Ä–µ–∑—É–ª—å—Ç–∞—Ç –∑ —É—Ä–∞—Ö—É–≤–∞–Ω–Ω—è–º –ø–æ—Ä–∞–¥–∏ —Ä–æ–∑–∫–ª–∞–¥—É.\n13) –í–∏—Å–Ω–æ–≤–æ–∫: –¥—Ä—É–∂–Ω—è –ø—ñ–¥—Ç—Ä–∏–º–∫–∞ —ñ –ø–æ–∑–∏—Ç–∏–≤–Ω–∞ –∞—Ñ—ñ—Ä–º–∞—Ü—ñ—è (30-35 —Å–ª—ñ–≤) –¥–ª—è $userName.\n–í–∏–º–æ–≥–∏: –∑–∞–≥–∞–ª—å–Ω–∏–π –æ–±—Å—è–≥ 400-500 —Å–ª—ñ–≤, –∂–∏–≤–∏–π —Ä–æ–∑–º–æ–≤–Ω–∏–π —Ç–æ–Ω, 4-6 –µ–∑–æ—Ç–µ—Ä–∏—á–Ω–∏—Ö –µ–º–æ–¥–∑—ñ; –∫–æ–∂–µ–Ω –±–ª–æ–∫ –≤—ñ–¥–æ–∫—Ä–µ–º–ª—é–π –ø–æ–¥–≤—ñ–π–Ω–∏–º –ø–µ—Ä–µ–Ω–æ—Å–æ–º —Ä—è–¥–∫–∞ (\\n); –Ω–µ –≤–∏–∫–æ—Ä–∏—Å—Ç–æ–≤—É–π —Å–∏–º–≤–æ–ª–∏ *, # –∞–±–æ —ñ–Ω—à—É —Ä–æ–∑–º—ñ—Ç–∫—É; –ø–∏—à–∏ –ª–∏—à–µ –ø—Ä–æ—Å—Ç–∏–º —Ç–µ–∫—Å—Ç–æ–º.';
